import React from 'react';
import PropTypes from 'prop-types';
import Link from 'next/link';

// Styling
import { Box, Container, Flex, Text } from '../styles';

const Header = () => (
  <Container>
    <Flex justifyContent="space-between" alignItems="center">
      <Link href="/">
        <a>Home</a>
      </Link>
    </Flex>
  </Container>
);

export default Header;
